import './App.css';
import { Menu } from './Menu/Menu'
import { Footer } from './Footer/Footer'

enum Category { movie, cartoon, series }

type Card = {
  title: string,
  year: number,
  type: Category,
  image: string,
}


function App() {
  return (
    <div className='App'>
      <Menu items={Object.keys(Category).filter(item => isNaN(Number(item)))}/>
      <Footer/>
    </div>
  );
}

export default App;
